import React from "react";
import { Container, Image } from "semantic-ui-react";
import name from "./";
import "./style.css";
import AOS from "aos";

const Home = () => (
  <Container id="home">
    <Image src={name} />
    <h3 className="titleJob">WEB DEVELOPER</h3>
  </Container>
);

export default Home;
